import Logo from "./image.png";
import "./styles.css";

const Main = () => {
    return (
        <div className="Logo-container">
            <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.workwise.io%2Fen%2Funternehmen%2F36261%2Fosapiens-services-gmbh&psig=AOvVaw3fc6Q9YP6h1be4nNZE3miy&ust=1625607511671000&source=images&cd=vfe&ved=0CAcQjRxqFwoTCIj0pYTyzPECFQAAAAAdAAAAABAy" alt="Logo" width="200"/>
        </div>    
     )
}

export default Main;
